var showWarn=(function(){return function(obj){var config=obj||{};var head=document.querySelector(".manage-content-head"),first=document.querySelector(".manage-content-first"),second=document.querySelector(".manage-content-second"),img=document.querySelector(".manage-image"),managerCancel=document.querySelector(".manager-cancel"),manager=document.querySelector(".manager"),element,handleClick=function(command){if(command=="block"){manager.style.display="block"}else{manager.style.display="none"}};try{element=document.querySelector(config.element)}catch(e){element=""}img.src=config.imgSrc?config.imgSrc:"https://mikuimg.oss-cn-shenzhen.aliyuncs.com/Plugin/warning/%E6%B0%B4%E6%9E%9C.png";head.innerText=config.headLine?config.headLine:"Error";first.innerText=config.firstLine?config.firstLine:"You do not have administrator privileges.";second.innerText=config.secondLine?config.secondLine:"Please get administrator privileges.";managerCancel.addEventListener("click",function(){handleClick("none")});if(element){element.addEventListener("click",function(){handleClick("block")})}else{manager.style.display="block"}}})();